    <p class=MsoNormal style='text-align:justify;background:#F2F2F2;mso-background-themecolor:
    background1;mso-background-themeshade:242'><span style='font-size:9.0pt;
    line-height:105%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify;background:#F2F2F2;mso-background-themecolor:
    background1;mso-background-themeshade:242'><span style='font-size:9.0pt;
    line-height:105%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;
    color:black;mso-themecolor:text1'>El color podría ser un tema más crucial
    de lo que imaginas en cualquier tipo de diseño. El efecto que los colores tienen
    sobre las personas, así como las sensaciones y emociones que generan en
    nosotros juegan un papel importante en la decisión de compra. <o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify;background:#F2F2F2;mso-background-themecolor:
    background1;mso-background-themeshade:242'><span style='font-size:9.0pt;
    line-height:105%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;
    color:black;mso-themecolor:text1'>Es obvio, entonces, que una marca tome
    precauciones al momento de elegir los colores que le identificarán. No sólo
    se seleccionan cuidadosamente los colores del logo, sino también de la
    página web e imágenes publicitarias que se difundirán en redes sociales, lo
    cual es una tarea complicada pues no sólo se debe tomar en cuenta la
    psicología del color sino también el contraste entre fondo y forma.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify;background:#F2F2F2;mso-background-themecolor:
    background1;mso-background-themeshade:242'><span style='mso-bidi-font-family:
    Calibri;mso-bidi-theme-font:minor-latin'><o:p>&nbsp;</o:p></span></p>
    </div>

    <div>
    <p class=MsoNormal style='text-align:justify;background:#F2F2F2;mso-background-themecolor:
    background1;mso-background-themeshade:242'><span style='font-size:9.0pt;
    line-height:105%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify;background:#F2F2F2;mso-background-themecolor:
    background1;mso-background-themeshade:242'><span style='font-size:9.0pt;
    line-height:105%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;
    color:black;mso-themecolor:text1'>La psicología del color, como su nombre
    indica, se refiere al estudio de las percepciones que tienen las personas
    sobre los colores. Por supuesto, los resultados pueden variar enormemente
    de acuerdo a la edad, el sexo y la cultura a la que pertenece cierto grupo
    de personas.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify;background:#F2F2F2;mso-background-themecolor:
    background1;mso-background-themeshade:242'><span style='font-size:9.0pt;
    line-height:105%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;
    color:black;mso-themecolor:text1'>La influencia de los colores sobre las
    personas no sólo se puede apreciar en el branding y el marketing, donde se
    emplea a beneficio de la marca sino en situaciones diarias como puede ser
    el color de los alimentos y cómo esta característica puede afectar la
    percepción que tenemos sobre estos antes de haberlos probado. Es decir,
    antes de probar cierta comida tenemos una idea de su sabor o intentamos
    predecirlo. Todo esto sucede de manera automática, nuestro cerebro asocia
    sabores de acuerdo al color.</span><span style='mso-bidi-font-family:Calibri;
    mso-bidi-theme-font:minor-latin'><o:p></o:p></span></p>
    </div>
    <![if !mso]></td>
   </tr>

  <![endif]></v:textbox>
